require "debug"
require "strscan"

data = DATA.read.chomp

def tick(string)
  new_string = ""
  scanner = StringScanner.new(string)

  until scanner.eos?
    segment = scanner.peek(2)

    if segment.codepoints.inject(&:-).abs == 32
      scanner.pos += 2
      new_string << scanner.rest
      scanner.terminate
    else
      new_string << scanner.getch
    end
  end

  new_string
end

loop do
  new_value = tick(data)

  if new_value == data
    puts new_value.length
    break
  else
    data = new_value
  end
end
__END__

